  const navigate = useNavigate();

  return (
    <div className="front-page">
      <header className="front-page-header">
        <h1>Welcome to the CSECU Family</h1>
        <p>Your gateway to the Computer Science Department of CSECU</p>
      </header>
      <main className="front-page-content">
        <div className="button-group">
          <button className="btn primary" onClick={() => navigate('/signup')}>
            Sign Up
          </button>
          <button className="btn secondary" onClick={() => navigate('/login')}>
            Login
          </button>
        </div>
      </main>
      <footer className="front-page-footer">
        <p>Â© {new Date().getFullYear()} CSECU. All Rights Reserved.</p>
      </footer>
    </div>
  );
}

